// src/App.jsx
import "./App.css";
import Home from "./pages/Home";
import Sobre from "./pages/Sobre"; // supondo que você tenha uma página Sobre.jsx
import logo from "./assets/logo.png"; // ajuste o caminho da sua logo

function App() {
  return (
    <div className="App">
      <header>
        <img src={logo} alt="Logo" className="logo" />
        <nav>
          <a href="#home">Home</a>
          <a href="#sobre">Sobre</a>
        </nav>
      </header>

      <main>
        <section id="home">
          <Home />
        </section>

        <section id="sobre">
          <Sobre />
        </section>
      </main>

      <footer>© 2025 Lista de Tarefas</footer>
    </div>
  );
}

export default App;
